import './App.css';
import Person from './Components/Person/Person';

class App extends Component {
  render() {
    return (
      <div className="app">
        <h1>Hi, I am React App</h1>
        <p>This is great!!!</p>
        <Person name="max"/>
        <Person name="Mini">I am learning react</Person>
      </div>
    );
  }
}

export default App;
